@POTUS I do not consent to any #ClimateScam 

You do not have the right to force us to pay for air, water, and nature.

Ask them why China is exempt from the corporate-globalist plans to destroy our lives.

@criticofpolecon Lenin formented a primarily industrial proleterian.

Mao recognised that China's revolution needed to come from the peasantry.

Knowing the importance and exploitation of workers in the service economy, it's pretty obvious they would play a huge role in any future revolution.
